import React from "react";
import Base from "./Base";
import { Wrapper } from "./ProfileStyle";

const Profile = ({id, page, onSummary, onProjects, onStatistics}) => {
    const userName = id;

    return (
        <Base>
            <span className="text-2xl text-green-500">{userName}</span> 's Profile
            <hr />
            <button
                className="ml-1.5 w-14 rounded text-white bg-blue-400 hover:bg-blue-500 text-sm"
                style={{ height: "35px" }}
                onClick={onSummary}>개요
            </button>
            <button
                className="ml-1.5 w-14 rounded text-white bg-blue-400 hover:bg-blue-500 text-sm"
                style={{ height: "35px" }}
                onClick={onProjects}>과제
            </button>
            <button
                className="ml-1.5 w-14 rounded text-white bg-blue-400 hover:bg-blue-500 text-sm"
                style={{ height: "35px" }}
                onClick={onStatistics}>통계
            </button>
            <Wrapper>
            </Wrapper>
        </Base>
    );
};

export default Profile;
